import AxiosClient from './axios-client';

const getAllApplicants = async () => {
  console.log('[applicantsService] getAllApplicants:');
  const result = await AxiosClient.get('localhost:8080/api/admin/applicants');
  console.log(result);
};

export default {
  getAllApplicants,
};
